/**
 * @description iconfont 库自带 json 配置文件中 glyph 的类型定义（原始）
 */
export interface GlyphRawSchema {
    icon_id: string;
    name: string;
    font_class: string;
    unicode: string;
    unicode_decimal: number;
}
/**
 * @description iconfont 库自带 json 配置文件中 glyph 的类型定义（camelcase）
 */
export interface GlyphSchema {
    id: string;
    name: string;
    fontFamily: string;
    prefix: string;
    fontClass: string;
    fullClassName: string;
    unicode: string;
    unicodeDecimal: number;
}
/**
 * @description iconfont 库自带 json 配置文件的类型定义（原始）
 */
export interface IconfontConfigRawSchema {
    id: string;
    name: string;
    font_family: string;
    css_prefix_text: string;
    description: string;
    glyphs: GlyphRawSchema[];
}
/**
 * @description iconfont 库自带 json 配置文件的类型定义（camelcase）
 */
export interface IconfontConfigSchema {
    id: string;
    name: string;
    fontFamily: string;
    prefix: string;
    description: string;
    glyphs: GlyphSchema[];
}
/**
 * @description iconfont 库对应的 symbol.ts 文件的类型定义
 */
export interface IconfontLoaderSchema {
    /**
     * @description iconfont 库的名称
     */
    name: string;
    /**
     * @description svg symbol 的加载函数
     */
    load: VoidFunction;
}
